tinymce.PluginManager.add("variable",function(t,n){var e=t.settings.variable;if(e.items){var a=[];console.log(e);for(var i=0;i<e.items.length;i++)a.push({text:e.items[i].text,onclick:function(n){return function(){t.insertContent('<span>&nbsp;</span><span data-id="'+e.items[n].id+'" class="insert_variable mceNonEditable"><strong>${'+e.items[n].text+"}$</strong></span><span>&nbsp;</span>")}}(i)});t.addButton("variable",{type:"menubutton",title:"插入变量",image:"http://gtms01.alicdn.com/tps/i1/TB1b5eNKXXXXXcuXVXXTyVt9VXX-128-128.png",menu:a})}});